#[cfg(test)]
mod tests {
    use heimdall_common::io::file::{read_file, delete_path};

    use crate::cfg::CFGBuilder;


    #[test]
    fn test_cfg_simple() {

        let bytecode = "";

        let lines = vec![
            String::from("0 [ label = \"0x01 PUSH20 0x1bf797219482a29013d804ad96d1c6f84fba4c45\\l0x16 ADDRESS \\l0x17 EQ \\l0x18 PUSH1 0x80\\l0x1a PUSH1 0x40\\l0x1c MSTORE \\l0x1d PUSH1 0x04\\l0x1f CALLDATASIZE \\l0x20 LT \\l0x21 PUSH2 0x58\\l0x24 JUMPI \\l\" ]"),
            String::from("0 -> 13 []")
        ];

        CFGBuilder::new(bytecode)
            .output("./output/tests")
            .generate();

        let dot = read_file(&String::from("./output/tests/cfg.dot"));

        for line in lines {
            assert!(dot.contains(&line))
        }

        delete_path(&String::from("./output/tests"));
    }

    #[test]
    fn test_cfg_complex() {

        let bytecode = "";

        let lines = vec![
            String::from("539 [ label = \"0x01d3 INVALID \\l\" ]"),
            String::from("537 -> 539 []")
        ];

        CFGBuilder::new(bytecode)
            .output("./output/tests")
            .generate();

        let dot = read_file(&String::from("./output/tests/cfg.dot"));

        for line in lines {
            assert!(dot.contains(&line))
        }

        delete_path(&String::from("./output/tests"));
    }
}